import React from "react";
import "./navbar.css";
import { Link } from 'react-router-dom'

class NavBar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav className="navbar navbar-expand-sm navbar-light bg-light">
              <Link to="/" className="navbar-brand">Fabricadabra</Link>
              {/* <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
              </button> */}
              <div  id="navbarNav">
                <ul className="navbar-nav">
                  <li id="nav1" className="nav-item"><Link className="nav-link" title="View My Stash" to="/myStash">View My Stash</Link></li>
                  <li id="nav2" className="nav-item"><Link className="nav-link" title="Add Fabric" to="/addFabric">Add Fabric</Link></li>
                </ul> 
              </div>
            </nav>
          );
    }
}

export default NavBar;
